import { createSlice } from "@reduxjs/toolkit";
import { useState, useEffect } from "react";

const userSlice = createSlice({
    name: 'user',
    initialState: null,
    reducers:  {
        getUser: (state, action) => {
            const username = action.payload.name
        }
    }

})

export default userSlice.reducer
